INSERT INTO `v10` VALUES (1,125000,'prelude to Earth’s Last Glacial Period: global average temperature never again as high until CE 2021, during intensifying anthropogenic warming '),(2,41500,'most recent reversal of Earth’s magnetic poles, lasting 500 years, decreasing stratospheric ozone, driving global climate shifts and extinction events '),(3,12800,'climate shift contributing to megafaunal extinctions and human cultural changes (Younger Dryas): triggered by a comet airburst over North America and Europe?'),(4,12000,'extinction of megafauna including woolly mammoths from continental Eurasia and North America, caused by human hunting and climate change '),(5,10000,'continental ice-sheets withdraw from Europe and North America'),(6,5300,'start of the Bronze Age (Near East), bronze replacing copper for weapons, tools, nails, utensils; mixing of Eurasian peoples -> rapid westward spread of farming, conversion of forest to dairy pasture '),(7,4200,'decline of Bronze-Age civilisations in Egypt, Greece and Mesopotamia, and terminal decline of Indus Valley civilisation, caused by centuries of drought beginning c. 2200 BCE'),(8,1500,'crop failures across the northern hemisphere caused by volcanic eruptions in Iceland; then bubonic plague (536-547) -> century of economic stagnation'),(9,720,'start of the northern hemisphere Little Ice Age (1300-1850) -> crop failures, social upheaval; perhaps curbed and curtailed by greenhouse-gas emissions during 8,000 years of forest clearance for agriculture'),(10,253,'invention of the first cost-effective steam engine (James Watt, Britain, 1769) -> powered machinery, Industrial Revolution'),(11,242,'mass production of spun textiles, mechanised by water power; coal-fired and steam-powered production of iron and steel (beginning Britain, c. 1780) -> economies of scale, rising polarisation of rich and poor nations, dominance of fossil fuels'),(12,200,'first prediction of Earth’s greenhouse effect (Joseph Fourier, France, 1822; tested empirically by Eunice Foote, USA, 1856, John Tyndall, Ireland, 1859) -> CO2 emissions from fossil fuels cause global climate warming'),(13,50,'recognition by governments worldwide that fossil-fuel combustion threatens Earth’s atmosphere (UN Conference on the Human Environment 1972), understood by the growing environmental movement as a crisis rooted in Western worldviews of nature as commodity'),(14,34,'first assessment that global climate warming has begun (James Hansen, Senate testimony to US Congress, 23/6/1988) -> creation of the IPCC, 1988; human imperative to stabilise climate change '),(15,19,'a heatwave across Europe causes 70,000 additional deaths in summer 2003, then with a return time of thousands of years -> 100 years by 2015; rising frequency of record-shattering climate extremes, including marine heatwaves'),(16,9,'atmospheric concentrations of CO2 exceed 400 ppm for the first time in at least 3 million years, an accelerating rise (NOAA, Hawaii, 5/2013) -> race for technologies to capture and use CO2'),(17,7,'three trillion trees on Earth (2015, cf. 6.6 trillion at the start of human civilisation), 15 billion culled annually -> forest covering a quarter of global land area, declining in extent and diversity, driven down by commodity production, wildfires, urbanisation'),(18,6,'global land and ocean surface temperature for 2016 reaches 0.99°C above the 1951-1980 mean, Earth’s warmest year on record to date -> roadmap for decarbonisation, implicating lifestyle choices'),(19,4,'sixfold increase in annual ice loss from Antarctica and Greenland over 25 years to 2018 -> sea-levels to rise 40-80 cm by 2100 under scenarios of low-high greenhouse-gas emissions, displacing 190-630 million people'),(20,3,'acidification of almost all open-ocean surface by absorption of anthropogenic CO2, losing 0.02 pH units per decade since 1990, with current harm and projected threats to shell-forming species '),(21,2,'global land and ocean surface temperature for 2020 exceeds 1°C above the 1951-1980 mean for the first time, 1.2°C above the pre-industrial 1850-1900 baseline, with 2011-2020 the 4th decade in succession to claim warmest average temperature');
